    def get_response(self, data):
        initial_post = self.api_client.post(self.submit_url, format='json', data=data)
        postjsoncontent = json.loads(initial_post.content)
        try:
            uuid = postjsoncontent['run_uuid']
        except Exception as e:
            error_msg = postjsoncontent['messages']['error']
            print("test_energy_burden API error message: {}".format(error_msg))
            raise e
        response = json.loads(self.api_client.get(self.results_url.replace('<run_uuid>', str(uuid))).content)
        return response
        #return self.api_client.post(self.reopt_base, format='json', data=data)

    def test_energy_burden(self):    
        ## function to test if energy burden inputs translate to outputs properly
        
        response = self.get_response(data=self.post)
        messages = response['messages'] #uncomment
        #self.assertHttpCreated(response) ## this is where it breaks
        #r = json.loads(response.content) 
        #run_uuid = r.get('run_uuid')
        #d = ModelManager.make_response(run_uuid=run_uuid)

        ## calculated outputs
        calculated_burden = response['outputs']['Scenario']['Site']['year_one_energy_burden_percent']
        total_energy_bill = response['outputs']['Scenario']['Site']['ElectricTariff']['year_one_bill_us_dollars']

        ## expected outputs
        expected_burden = total_energy_bill/(response['inputs']['Scenario']['Site']['annual_income_dollars'])
    
        ## test equivalence
        self.assertEqual(response['outputs']['Scenario']['Site']['year_one_energy_burden_percent'], round(expected_burden, 4),
                        msg="Year one energy burden ({}) does not equal expected year 1 energy burden ({})."
                        .format(response['outputs']['Scenario']['Site']['year_one_energy_burden_percent'], expected_burden))

        ## send data to file
        data_file = open("reopt_results.json", "w")
        json.dump(response, data_file, indent = "")
        data_file.close()